import React from 'react';
import PropTypes from 'prop-types';

function Button({ btnName }) {
  return (
    <button type="button">
      { btnName }
    </button>
  );
}

export default Button;

Button.propTypes = {
  btnName: PropTypes.string.isRequired,
};
